import { Link } from 'react-router-dom';
import './style.css';
export default function Header() {
  return (
    <header>
        <div className="fixed top-0 h-[56px] w-[100%] bg-primary z-50 shadow-[1px_8px_15px_-7px] shadow-shadow-2 grid grid-cols-3 text-primary-color"></div>
        <div className="flex items-center gap-[10px] justify-center header_middle"></div>
        <div className="flex absolute right-2 top-[50%] translate-y-[-50%] header_right"></div>
    </header>

  )
}
